import React from 'react';

function SearchBar(){
  return (
    <div>
      <input type='text' />
      <button>HOla</button>
    </div>
  )
}

const Pokedex = () => (
  <div className="pokedex page">
    <h1>Pokedex</h1>
    <SearchBar />
  </div>
);

export default Pokedex;
